import React from "react";
import MenuNav from "../Components/MenuNav";

function Authorization() {
    return (
        <div className="authorization">
            <MenuNav />
            <div className="authForm">
                <form>
                    <h4>Вход/Регистрация</h4>
                    <label htmlFor="phone">Введите номер телефона</label>
                    <input type="phone" placeholder="+" id="phone" />
                    <button type="submit">Войти</button>
                </form>
                <form>
                    <h4>Подтверждение номера</h4>
                    <label htmlFor="phone">Введите номер телефона, чтобы получить код подтверждения</label>
                    <input type="phone" placeholder="+" id="phone" />
                    <button type="submit">Войти</button>
                </form>
            </div>
        </div>
    );
}

export default Authorization;
